

//declaración de variables globales
var iCnt = 1;
var tS= new Array()

// funcion para añadir cuadro en cualquier sección
function addElemento(elemento){
    var seccion=$("#cuadros-"+elemento.id)
    seccion.append('<div class="caja-elemento" id="cajaElemento'+elemento.id+''+iCnt+'"><textarea class="titulotx" rows="1" onKeyUp="controlTextArea(this,20);" id="titulo' +elemento.id+ ''+iCnt+'" /><span onclick="eliminarelem(this)" class="eliminarelem glyphicon glyphicon-remove"></span><textarea class="textos" id="tx' +elemento.id+ ''+iCnt+'" onKeyUp="controlTextArea(this,60);" value="Elemento de Texto ' + elemento + '" /></div>');
    iCnt = iCnt + 1;
}

// elimina cualquier cuadro de cualquier sección
function eliminarelem(elemento){
    $(elemento).parent().remove()
}

// aumenta o disminuye el tamaño de un textarea de acuerdo a su contenido
function controlTextArea(elemento,altInicial){
    var altoExt = $("#"+elemento.id).height()
    var altoInt = $("#"+elemento.id).get(0).scrollHeight;
    if(altoInt > altoExt){
        $("#"+elemento.id).animate({
            height: altoInt+"px"
        },"fast");
    }else{
        $("#"+elemento.id).css({
            height: altInicial+"px"
        });
        var altoInt = $("#"+elemento.id).get(0).scrollHeight;
        if(altoInt > altInicial){
            $("#"+elemento.id).css({
                height: altoInt+"px"
            });
        }
    }
}

// lee los cuadros de una sección y los añade a un arreglo de objetos
function htmltoJSONCanvas(seccionCanvas, tituloSeccion){
    var arreglo= new Array();
    var cadena = [{text: tituloSeccion+'\n\n', bold: true, alignment: 'left', fontSize: 14}]
    var contenidoTabla=$('#'+seccionCanvas+'>.caja-elemento')
    if(contenidoTabla.length>0){
        contenidoTabla.each(function(indice,element){ 
            var titulotx=String( $(this).children()[0].value)
            var textotx =String( $(this).children()[2].value)
            cadena.push({text: titulotx+'\n', italics: true, alignment: 'left',fontSize: 10},{text: textotx+'\n\n', fontSize: 8, color:'gray', alignment: 'left'})
        }); 
    }
    else{
         cadena.push({text: '\n\n\n\n\n\n\n\n'})
    }
    return cadena 
     
}


